    DescribeDcdnBgpBpsData(query: DescribeDcdnBgpBpsDataRequest): Promise<DescribeDcdnBgpBpsDataResponse>;
    /**
     * 调用DescribeDcdnBgpTrafficData查询BGP加速五分钟粒度流量数据。
     */
    DescribeDcdnBgpTrafficData(query: DescribeDcdnBgpTrafficDataRequest): Promise<DescribeDcdnBgpTrafficDataResponse>;
